/* eslint-disable */
import axios from "axios";
import { useEffect, useState } from "react";

function Search(props) {
  const arr = props.names.split(" ");
  var searchWords = {};
  let temp = "asdf";

  useEffect(() => {
    console.log(temp);
  }, []);

  // JSON 형식으로 값 저장
  for (var i in arr) {
    var queryWords = arr[i];
    searchWords[queryWords] = "number";
  }
  useEffect(() => {
    try {
      var url = "http://127.0.0.1:8000/api/";
      if (props.typeSelect === "dog") {
        url += "dog";
      } else {
        url += "cat";
      }

      axios
        .get(url, {
          params: { breed: props.breed },
        })
        .then((response) => {
          const searchResults = response.data;
          temp = JSON.stringify(searchResults[0]);
        });
    } catch (error) {
      console.error(error);
    }
  }, [temp]);

  return <h1>{temp}</h1>;
}

export default Search;
